import React from 'react'

const Details = () => {
    return (
        <div>
            <div>
                <p className='font-bold'>Request for Quote</p>
                <p className='text-[13px]'>Fill out these details to send the RFQ</p>
            </div>
        </div>
    )
}

export default Details
